import {appConstants} from "../constants/constant";


export const applicationReducer = (state = null, action) => {
    switch(action.type) {
        case appConstants.GET_APPLICATION:
            console.log('GET_APPLICATION');
            return action.payload.data;
        case appConstants.GET_APPS:
            console.log('applicationsReducer: ' + action.payload.data);
            return null;
            // return action.payload.data;
        default:
            return state;
    }
};
